Sin Re-cortes en corto

&nbsp;

El alumnado de 4º ESO-C del IES Arucas-Domingo Rivero ha sido galardonado en el XIII Certamen de  cine educativo Sin Re-cortes en corto de la Consejería de Educación del Gobierno de Canarias con el premio a mejor Booktrailer y Microcorto en Educación Secundaria Obligatoria. El booktrailer presentado por el alumnado y realizado en la materia de Trabajo Monográfico “ScienceCinema” se titula “El despertar de las musas”. El libro de Beatriz Luengo ha servido de base a partir del cuál trabajar diferentes competencias con el alumnado. Felicitaciones a todo el alumnado por su trabajo.
